import React, {useState} from "react";

import LineTitle from "../Components/LineTitle"

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faEnvelope, faPhone } from '@fortawesome/free-solid-svg-icons'

function GetInTouch() {
    const [style1, setStyle1] = useState({display: 'none'});
    const [style2, setStyle2] = useState({display: 'block'});

    return(
        <div 
            onMouseEnter={e => {
                setStyle1({display: 'block'});
                setStyle2({display: 'none'});
            }}
            onMouseLeave={e => {
                setStyle1({display: 'none'});
                setStyle2({display: 'block'});
            }} 
            className="Contact"
        >   
            <div className="outer">
                <div className="middle">
                    <div style={style2}>
                        <div className="inner">
                            <LineTitle  NoLine={true} Light={false} Title="Get In Touch!"/>
                        </div>
                    </div>
                    <div style={style1}>
                        <div className="inner">
                            <a href="tel:+91-9910584860" className="FontAwesomeIcon VySmFont NavBarText">
                                <FontAwesomeIcon icon={faPhone} />
                            </a>
                            <a className="FontAwesomeIcon VySmFont NavBarText" href='mailto:dt.rashumalhotra@gmail.com'>
                                <FontAwesomeIcon icon={faEnvelope} />
                            </a>
                        </div>
                    </div>             
                </div>
            </div>         
        </div>
    );
}

export default GetInTouch;
